import React from 'react';
import logo from './logo.svg';
import './App.css';
import HoverCard from './HoverCard.js'

function App() {
  return (
    <div className="App">
      <header className="App-header">
        Hello World
          <HoverCard imageURL="./logo192.png" bottomText="Hello World!" centerText={"Hello again!"}/>
      </header>
    </div>
  );
}

export default App;
